<node CREATED="1566553054771" ID="ID_1290851418" MODIFIED="1566553054771" TEXT="A database management system (DBMS) is system software for creating and managing databases.The DBMS provides users and programmers with a systematic way to create retrieve update and manage data.A DBMS makes it possible for end users to create read update and delete data in a database. The DBMS essentially serves as an interface between the database and end users or application programs " />
</node>
